    const [categories, setCategories] = useState(['One Punch','Samurai X']);

    return (
        <>
            <h1>GifExpertApp</h1>
            <AddCategory setCategories={setCategories} />
            <hr />

            <ol>
                {
                    categories.map(category => {
                        <li key= { category }> { category }</li>
                    })
                }
            </ol>

        </>)
}
